local Main = MakeTab({Name = "Main"})

MakeNotifi({
  Title = "ARBIC HUB",
  Text = "JOIN OUR TELEGRAM",
  Time = 5
})

local section = AddSection(Main, {"ITEMS"})

local isGivingItems = false  -- State variable to track if item giving is active

-- Toggle button for starting/stopping item giving
local Toggle = AddToggle(Main, {
  Name = "Toggle Item Giving",
  Default = false,
  Callback = function(Value)
    isGivingItems = Value  -- Update the state based on the toggle value

    if isGivingItems then
      print("Item giving started.")
      while isGivingItems do
        local items = {
          "Kjspawn", "OrbBomb", "OrbCandy", "OrbHalloween", "OrbQuake", 
          "OrbShanks", "Orbblack", "Orbblue", "Orbcures", "Orbflame", 
          "Orbgreen", "Orbkj", "Orbshadow", "Orbsky", "finger"
        }

        for _, item in ipairs(items) do
          local args = {
            [1] = "Change",
            [2] = item,  -- Each item to be given
            [3] = "Inv"
          }

          local success, err = pcall(function()
            game:GetService("ReplicatedStorage").Inventory:FireServer(unpack(args))
          end)

          if not success then
            print("Error giving item:", err)  -- Print any errors that occur
          end
        end

        wait(1)  -- Optional: wait time between item-giving iterations
      end

      print("Item giving stopped.")
    else
      print("Item giving toggled off.")
    end
  end
})

-- Button for one-time item giving
AddButton(Main, {
  Name = "Spam Give All Items",
  Callback = function()
    local items = {
      "Kjspawn", "OrbBomb", "OrbCandy", "OrbHalloween", "OrbQuake", 
      "OrbShanks", "Orbblack", "Orbblue", "Orbcures", "Orbflame", 
      "Orbgreen", "Orbkj", "Orbshadow", "Orbsky", "finger"
    }

    for _, item in ipairs(items) do
      local args = {
        [1] = "Change",
        [2] = item,  -- Each item to be given
        [3] = "Inv"
      }

      local success, err = pcall(function()
        game:GetService("ReplicatedStorage").Inventory:FireServer(unpack(args))
      end)

      if not success then
        print("Error giving item:", err)  -- Print any errors that occur
      end
    end

    print("Attempted to give all items.")
  end
})
